        start = _maybe_localize_point(
            start,
            getattr(start, "tz", None),
            start,
            freq,
            tz,
            ambiguous,
            nonexistent,
        )
        end = _maybe_localize_point(
            end, getattr(end, "tz", None), end, freq, tz, ambiguous, nonexistent
        )
